        <img src={logo} className="App-logo" alt="logo" />
        <p style = {{
          color: 'yellow',
          fontSize: 46
        }}>
          Hello, my name is {name}
        </p>
        <p style = {{
          color: 'yellow'
        }}>
          I have {2} apples. My friend has {2+2} apples. {flag && 'Flag is true'}
        </p>
        {flag && <p> We are happy</p>}
        {flag && <p> We are happy</p>}
